import React from 'react';
import FoodItem from './FoodItem.js';
import {CardDeck} from "react-bootstrap";
import Modal from 'react-modal';

let foodList = [
    {

        src: "data:image/jpeg;base64,",
        title: "Pizza",
        cost: 5
    },
    {

        src: "data:image/jpeg;base64,",
        title: "Pizza",
        cost: 6
    },
    {

        src: "data:image/jpeg;base64,",
        title: "Pizza",
        cost: 7
    }
];
const renderFoodList = () => {
    const colors = [
        'Success',
        'Danger',
        'Warning',
        'Info',
        'Light',
        'Dark',
    ]

    return foodList.map(
        (item, idx) =>
            <FoodItem
                variant={colors[idx % colors.length]}
                src={item.src}
                title={item.title}
                cost={item.cost}
            />
    )
};


const FoodList = () => {

    return (
        <>

            <div>
                <h2>Menu</h2>
                <CardDeck>
                    {renderFoodList()}
                </CardDeck>

            </div>

        </>
    );
}

export default FoodList;
